/*
* Dark Light Version
*/
var html = document.querySelector('html'),
darkLight = document.querySelector('.dark-light')
darkLight.addEventListener('click', function(){
   if(html.getAttribute('data-theme') === 'dark'){
       html.setAttribute('data-theme', 'light')
       localStorage.setItem('selected-theme', 'light');
   }else{
       html.setAttribute('data-theme', 'dark')
       localStorage.setItem('selected-theme', 'dark');
   }
})


/*
Scripts activation code
*/

$(document).ready(function () {
    'use strict';
    // bar-icon        
    $('.bar-icon').on('click', function(){
        $(this).toggleClass('active-bar');
        $('#nav').toggleClass('active')
        $('body').toggleClass('overflow-hidden')
    }); 

    // members-image        
    $('.members-image').on('click', function(e){
            e.stopPropagation()
            $(this).parents('.members-details').children('.members-info').toggleClass('active')
    });
    $('.members-info').on('click', function(e){
        e.stopPropagation()
    })
    $(document).on('click', function() {
        $('.members-info').removeClass('active')
        $('.sidebar-docs').removeClass('active')
        $('body').removeClass('overflow-hidden')
    });

    // sidebar-icon       
    $('.sidebar-toggle-icon').on('click', function(e){
        e.stopPropagation()
        $('.sidebar-docs').toggleClass('active')
        $('body').toggleClass('overflow-hidden')
    });

    $('.sidebar-docs').on('click', function(e){
        e.stopPropagation()
    });


    // fitVids js
    $('.kg-embed-card').fitVids()

    // FAQ  
    $('.expand-toggle').on('click', function (e) {
        e.preventDefault()
        var $this = $(this)
        $this
            .parent().parent()
            .toggleClass('active')
            .next()
            .slideToggle()
            .parent().addClass('active')
            .siblings().removeClass('active')
            .children('.faq-qus-title, .tag-qus-title')
            .removeClass('active')
            .next()
            .slideUp()
    })

        
    // IMG to SVG
    function jetix_svg() {
        jQuery('img').each(function () {
            var jQueryimg = jQuery(this);
            var imgClass = jQueryimg.attr('class');
            var imgURL = jQueryimg.attr('src');
            jQuery.get(imgURL, function (data) {
                // Get the SVG tag, ignore the rest
                var jQuerysvg = jQuery(data).find('svg');

                // Add replaced image's classes to the new SVG
                if (typeof imgClass !== 'undefined') {
                    jQuerysvg = jQuerysvg.attr('class', imgClass + ' replaced-svg');
                }
                jQuerysvg = jQuerysvg.removeAttr('xmlns:a');
                // Replace image with new SVG
                jQueryimg.replaceWith(jQuerysvg);

            }, 'xml');

        });
    }
    $(document).each(function () {
        jetix_svg();
    })

    // scroll bar code
    $(".nicescrol").niceScroll({
        autohidemode: false,
    });

    // Search results        
    var posts = [],
    searchKey = $(".search-input"),
    searchContent = $('.search-full-content')

    if (posts.length == 0 && typeof serachContentApi !== undefined) {
        $.get(serachContentApi)
            .done(function(data) {
                posts = data.posts
                search()
            })
            .fail(function(err) {
                console.log('failed')
            })
    }

    
    $('.icon_close').on('click', function () {
        searchRemover()
    });
    $(document).on('click', function () {
        searchRemover()
    });
    function searchRemover(){
        $('.search-result').removeClass('active')
        searchKey.val('')
        searchContent.empty()
    }

    function search(){
        var options = {
            shouldSort: true,
            tokenize: true,
            matchAllTokens: true,
            threshold: 0,
            location: 0,
            distance: 100,
            maxPatternLength: 32,
            minMatchCharLength: 1,
            keys: [{
              name: 'title',
              weight: 0.3
            }, {
              name: 'html',
              weight: 0.7
            }]
          };
          var fuse = new Fuse(posts, options)
          
        searchKey.on('keyup', function(){
            var value = this.value,
            search = fuse.search(value),
            output = '',
            searchResultnum = $('.no-result')
            $('.search-result').addClass('active')
            searchResultnum.addClass('d-block')
            searchResultnum.children('span').html(search.length)
            if(posts.length > 0){
            $.each(search, function(key, val) {
                    output += `
                    <a class="single-search-result" href="${val.url}">
                        <div class="single-result-item">
                            <div class="result-title d-flex align-items-center">
                                <h5 class="post-title">${val.title}
                                ${val.primary_tag&&`<span class="p-tag">${val.primary_tag.name}</span>`}
                                </h5>
                            </div>
                            <p class="post-text">${val.excerpt}</p>
                        </div>
                    </a>
                    `
                })

                searchContent.html(output)
            }
        })
    }

    // Load more posts JS
    var nextPage = $('link[rel=next]').attr('href'),
        a = $('.load-more-posts'),
        b = $('.loadmore-section')

    if (!nextPage) {
        b.addClass('d-none')
    }
    a.click(function(n) {
        n.preventDefault()
        var i =
            nextPage.split(/page/)[0] +
            'page/' +
            pagination_next_page_number +
            '/'
        $.ajax({
            url: i,
            beforeSend: function() {
                a.children('.loading-posts').show()
            },
        }).done(function(data) {
            var posts = $('.post-card', data),
                postwrapper = $('.posts-wrapper')
            postwrapper.append(posts)
            a.children('.loading-posts').hide()
            pagination_next_page_number++
            pagination_next_page_number >
                pagination_available_pages_number &&
                b.remove()
        })
    })


    // Sidebar menu active link
    var $location = window.location.href
    $location = $location.split('/')
    var $slug = $location[$location.length - 2],
        $tag = $('.tag-qus-title'),
        $tagName = $tag.find('a'),
        $sidebar = $('.docs-articles'),
        $sidebarLink = $sidebar.find('a'),
        $parentActive = true
    
    $tagName.each(function(){
        var $tagNameId = $(this).attr('id')
        if($tagNameId === $slug){
            $(this).parents('.tag-qus-title').addClass('active').next().show()
        }
    })
    $sidebarLink.each(function(){
        var $sidebarLinkId = $(this).attr('id')
        if($sidebarLinkId === $slug){
            $(this).addClass('active')
            if($parentActive){
                $(this).parents('.docs-ans').show().prev().addClass('active')
                $parentActive = false
            }
        }
    })
    

    // Copy link
    $('.copy-link').on('click', function(e){
        e.preventDefault()
        var url = $(this).data('link')

        var $temp = $("<input>");
        $("body").append($temp);
        $temp.val(url).select();
        document.execCommand("copy");
        $temp.remove();
        $('.copied').fadeIn()

        setTimeout(function(){
            $('.copied').fadeOut()
        }, 1000)
    })

    

})